export  const data = [
    {
        question: "ขั้นตอนการสมัคร",
        answer:"ไปที่ลงชื่อเข้าสู่ระบบ จากนั้น เลือก สมัครสมาชิก "
    },
    {
        question: "เกิดข้อผิดพลาด 500 คือ อะไร",
        answer:"เกิดจากปัญหาทาง serve กรุณาติดแอดมินให้รีบทำการแก้ไข"
    }
]
